<tr><th class="row-header freezebar-origin-ltr header-shim row-header-shim"></th><th id="1385504755C0" style="width:67px" class="header-shim"></th><th id="1385504755C1" style="width:1789px" class="header-shim"></th></tr></thead><tbody><tr style='height:39px;'><th id="1385504755R0" style="height: 39px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 39px;">1</div></th><td class="s0">21/1/2015</td><td class="s1">Assalamuaalikum, Peace to all. Its that time of year in Brunei where we are getting flooding in a lot of areas. Heavy rainfall from the monsoon season, unsanitary conditions from flooding will likely contribute to infection too.<br>Please be careful, wash your hands often. Keep safe. Eat a lot of fruit and vege. Keep hydrated. And HAVE A PLAN for you and your family if the flooding affects you</td></tr><tr style='height:39px;'><th id="1385504755R1" style="height: 39px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 39px;">2</div></th><td class="s0">21/1/2015</td><td class="s1">Remember the really bad storm couple nights ago! Our office flooded, had our shop night standby staff elmer, jo, and joko up at 2am saving the office! Morning after, tree trunks banged up on our ramp! :(<br>Morning everyone to the rescue! Harry repairing! Afiq and Kenny making legs for office furniture so no future water damage! Thanks night watch guys!</td></tr><tr style='height:19px;'><th id="1385504755R2" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">3</div></th><td class="s0">21/1/2015</td><td class="s2">Limbang-Brunei 32km main road to bandar limbang and limbang to brunei - miri …. Flooded with water… pray for limbang…pray for sarawak…the bad flash flood in limbang 2015</td></tr><tr style='height:19px;'><th id="1385504755R3" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">4</div></th><td class="s0">21/1/2015</td><td class="s2">Confirm! Limbang - Brunei Road flooding until now! Getting Worst !</td></tr><tr style='height:39px;'><th id="1385504755R4" style="height: 39px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 39px;">5</div></th><td class="s0">21/1/2015</td><td class="s1">Teacher in Brunei going extra miles for students to go to school safely during floods.<br>~Photo forwarded in WhatsApp</td></tr><tr style='height:39px;'><th id="1385504755R5" style="height: 39px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 39px;">6</div></th><td class="s0">21/1/2015</td><td class="s1">A Teacher in Brunei seen carrying a student to the Parent across the flooding water. Really respect to all the Teachers involved.<br>~Photo forwarded in WhatsApp.</td></tr><tr style='height:199px;'><th id="1385504755R6" style="height: 199px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 199px;">7</div></th><td class="s0">21/1/2015</td><td class="s1">Latest #weather update courtesy of #Brunei Darussalam Meteorological Department, Ministry of Communications (http://bit.ly/1dYWsmf)<br>Wednesday | 30 Rabiulawal 1436H / 21 January 2015<br>Weather<br>Occasional showers, heavy and thundery at times, are expected in between Cloudy period. [ADVISORY: Risk of flash flood in heavy or continuous rain-showers, especially at low-lying and flood prone areas]<br>Outlook to tomorrow morning<br>Occasional showers or thundershowers are still expected at night.<br>Wind<br>From Southwest at 05-10km/h in the morning; and from Northwest or Northeast at 10-25km/h in the afternoon. [ADVISORY: Speed of up to 50 km/h in heavy or thundery showers]<br>Temperature<br>24°C , 30°C</td></tr><tr style='height:59px;'><th id="1385504755R7" style="height: 59px;" class="row-headers-backgrou