n from His Majesty to King Salman bin Abdulaziz Al-Saud following his succession as the Custodian of the Two Holy Mosques and the new King of the Saudi Arabia. – Abdul Azim Kassim</td></tr><tr style='height:19px;'><th id="1385504755R186" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">187</div></th><td class="s0">25/1/2015</td><td class="s2">PHOTO: A resident of Kg Mulaut wades through a flooded road last night. Heavy rain and river overflows have led to flooding in many areas in Brunei, including Jangsak, Kumbang Pasang, Mulaut, Jerudong and Airport Lama. Picture: BT photo</td></tr><tr style='height:19px;'><th id="1385504755R187" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">188</div></th><td class="s0">25/1/2015</td><td class="s3 softmerge"><div class="softmerge-inner" style="width: 1897px; left: -1px;">The flood and setbacks with the engine of the boat yesterday did not stop Royal Brunei Police Force personnel (RBPF) from the force’s headquarters in Gadong in carrying a blood donation drive. Read more on this news story here http://tinyurl.com/l68ha9v</div></td></tr><tr style='height:19px;'><th id="1385504755R188" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">189</div></th><td class="s0">25/1/2015</td><td class="s2">Floods were reported in 13 sub-s of the Brunei-Muara, Tutong and Temburong s after a heavy downpour on Saturday night http://tinyurl.com/kxjyh49</td></tr><tr style='height:359px;'><th id="1385504755R189" style="height: 359px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 359px;">190</div></th><td class="s0">25/1/2015</td><td class="s1">3 expats killed in landslide<br>YOU MIGHT ALSO LIKE:<br>Youth put behind bars for stealing cables<br>Indera win DST Sumbangsih Cup<br>Man charged with rape<br>26-year-old soldier wins house<br>ABDUL AZIM KASSIM AND QURATUL-AIN BANDIAL<br>BANDAR SERI BEGAWAN<br>Sunday, January 25, 2015<br>THREE foreign nationals lost their lives in a landslide at a construction site in Kampung Sungai Tilong last night, the police confirmed.<br>“It can be confirmed that there were three fatalities, involving all foreigners,” said a spokesperson from the Royal Brunei Police Force (RBPF).<br>The incident happened on Jalan Aman at Kampung Sungai Tilong.<br>The spokesperson said RBPF will continue with its investigation and provide additional information after the preliminary probe.<br>When contacted, the Fire and Rescue Department’s hotline confirmed a WhatsApp message regarding the landslide that was circulated on the social media.<br>The department hotline said a person called at 5.16pm to report the landslide at the Aman Hill Construction Site at Sg Akar.<br>According to the social media, the landslide buried four people.<br>Two of the victims were taken out by members of the public before the firemen reached the scene.<br>When Brunei Times tried to reach the accident spot at 11.50pm a section of the road leading to the accident site could not be accessed due to flooding.</td></tr><tr style='height:39px;'><th id="1385504755R190" style="height: 39px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 39px;">191</div></th><td class="s0">25/1/2015</td><td class="s1">raaaiinnn...listening to the radio and heard few areas have been inflicted with the flood...May Allah protect us<br></td></tr><tr style='height:19px;'><th id="1385504755R191" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">192</div></th><td class="s0">25/1/2015</td><td class="s2">Road of Rambai flooded</td></tr><tr style='height:19px;'><th id="1385504755R192" style="height: 19px;" class="row-headers-background row-header-