nei</td></tr><tr style='height:19px;'><th id="1385504755R287" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">288</div></th><td class="s0">26/1/2015</td><td class="s2"></td></tr><tr style='height:359px;'><th id="1385504755R288" style="height: 359px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 359px;">289</div></th><td class="s0">26/1/2015</td><td class="s1">Police help Neighbourhood Watch monitor crimes<br>The Police officers take a group photo with the Bengkurong Neighbourhood watch before commencing with “Operasi Cegah Jenayah” in Kg Bengkurong on January 24. Courtesy of RBPF<br>YOU MIGHT ALSO LIKE:<br>Floods reported in 13 sub-s across Brunei<br>Good habits: Teaching your kids to save for a rainy day<br>Taking private jobs in a positive way<br>Taufiq sent packing in KL<br>BANDAR SERI BEGAWAN<br>Monday, January 26, 2015<br>POLICE officers totaling 137 from six stations across the Brunei-Muara  conducted two separate operations in Kg Bengkurong and commercial sites to monitor and prevent crime recently.<br>Getting together with Kg Bengkurong’s Neighbourhood Watch, the first operation conducted on January 24, saw a team of 20 police officers and seven Neighbourhood watch members led by Senior Superintendent of Police Station BSB, ASP Hj Naguib Dato Paduka Haj Ismail and Kg Bengkurong Village Head, Hj Talip Hj Bakar patrolling around Kg Burung Lepas and Kg Sinarubai.<br>The second operation, according to an Royal Brunei Police Force (RBPF) statement, led by Assistant Officer in Command of Police  (Brunei-Muara Police ), Superintendent Hjh Dayang Hj Omar went on foot patrols around Kg Serusop from Melabau Complex to Kiulap and Gadong commercial s.<br>The statement added that the objective of the operations dubbed “Operasi Cegah Jenayah” was to show police vigilance and presence in curbing criminal activities in the areas.<br>The operations lasted until 2am, it added.<br>Police also highlighted their efforts to provide assistance to the public during the heavy rains by diverting traffic in the Berakas and Bandar Seri Begawan areas. - Abdul Aziz Ismail<br>The Brunei Times</td></tr><tr style='height:19px;'><th id="1385504755R289" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">290</div></th><td class="s0">26/1/2015</td><td class="s2">Following several hours of heavy downpours overnight, several low-lying areas around the country were inundated by flash flood in the Brunei Muara , Mukim Kilanas and Mukim Sengkurong were among the worst hit areas.</td></tr><tr style='height:39px;'><th id="1385504755R290" style="height: 39px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 39px;">291</div></th><td class="s0">26/1/2015</td><td class="s1">BT :<br>&quot;only two minor incidents were reported in Kg Kupang, Tutong , whereby a house was submerged in 0.10m of flood water and a tree was uprooted in the aftermath of the heavy rain&quot;</td></tr><tr style='height:19px;'><th id="1385504755R291" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">292</div></th><td class="s0">26/1/2015</td><td class="s2">Battalion Headquarter area at Tuker Lines (Brunei) is flooded due to heavy rain last night.</td></tr><tr style='height:19px;'><th id="1385504755R292" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">293</div></th><td class="s0">26/1/2015</td><td class="s2">HOTO: To view photos of areas affected by floods Click the following link http://tinyurl.com/kts2gcr</td></tr><tr style='height:19px;'><th id="1385504755R293" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">294</div></th><td class="s0">26/1/2015</td><td class="s3 softmerge"><div class="softmerge-inner" style="width: 2007px; left: -1px;">My Utmost respect to His Majesty the Sultan of Brunei for coming over himself to look over at the flooded areas and care for the flood victims. May Allah bless him and bless his reign with peace and prosperity. May he live long to reign over us and guide us as a Great Ruler</div></td></tr><tr style='height:419px;'><th id="1385504755R294" style="height: 419px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 419px;">295</div></th><td class="s0">26/1/2015</td><td class="s1">Jerudong food court hit by power outage<br>Jerudong Park Country Club Food Court was hit by a power outage Saturday night due to flooding, leaving its restaurants unable to operate. BT/Izzati Jalil<br>YOU MIGHT ALSO LIKE:<br>Taufiq sent packing in KL<br>Call to set up centre for local goods<br>Kg Kiudang introduces new ‘bed and breakfast’ home<br>Sengkurong B into last four<br>IZZATI JALIL<br>BANDAR SERI BEGAWAN<br>Monday, January 26, 2015<br>JERUDONG Park Country Club Food Court was plunged into darkness following a power outage Saturday evening.<br>The outage, which lasted more than 15 hours, was believed to be caused by flooding in the area following a heavy downpour.<br>As a result, restaurants at the food court were unable to operate.<br>Jim Tokkong, a waiter at one of the restaurants, said they had to cut back their business hours as they were unable to cook.<br>“We usually operate until midnight or sometimes even later, especially since Jerudong Park is everyone’s favourite place to be on a Saturday night. But due to the power outage, our boss told us to pack up and resume the next day,” he said.<br>Speaking to The Brunei Times, a customer, 60-year-old Hjh Sarbenun Hj Mohammad, said she was disappointed when they turned down her order.<br>“I thought why not order some ice kacang while I wait for my grandchildren to finish playing in the park, as it was a hot day. I was quite disappointed when they couldn’t serve me because there was no electricity for the ice kacang machine to run,” she said.<br>According to a security guard who was on duty at the park, the downpour started around 10.30pm and only stopped around 4am.<br>“A lot of cars couldn’t access the road to the food court due to flooding -- not even the fire brigade,” he said.<br>Electricity to the food court was restored just before 6pm yesterday.<br>The Brunei Times</td></tr><tr style='height:19px;'><th id="1385504755R295" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">296</div></th><td class="s0">26/1/2015</td><td class="s2">Authority Steps Up Effort to Aid Flood Victims | http://bit.ly/1z43Uck #Brunei</td></tr><tr style='height:19px;'><th id="1385504755R296" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">297</div></th><td class="s0">26/1/2015</td><td class="s3 softmerge"><div class="softmerge-inner" style="width: 2062px; left: -1px;">The emergency line 993 of the Fire and Rescue Services in the Brunei Muara  received 15 calls on floods and 8 calls on landslides. RTB&#39;s crew took a look at several places affected by flood. Among the areas were Ban-3 and Ban-6 in Kampung Mulaut - identified as flood-prone.</div></td></tr><tr style='height:19px;'><th id="1385504755R297" style="height: 19px;" class="row-headers-background row-header-shim"><div class="row-header-wrapper" style="line-height: 19px;">298</div></th><td class="s0">26/1/2015</td><td class="s2">Water levels in most flood-prone areas across Tutong  have dissipated except for Jalan Layong in Mukim Lamunin and Jalan Kg Batang Mitus in Mukim Kiudang http://tinyurl.com/ohdagly</td></tr><tr style='height:19px;'><th id="1385504755R298" style="height: 19px;" class="row-headers-background row-header